import React from "react";
import styled from "styled-components";
import getHour from "../customFunctions/getHour";
const Test = styled.li`
    list-style: none;
`;
const listItem = ({ type, places, date }) => {
    return (
        <Test>
            {type} : {getHour(date)}{" "}
        </Test>
    );
};

export default listItem;
